func testUsdaNutrientToManyRemoveOpNutrientUsdaNutrientIncomingNames(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a UsdaNutrient
	var b, c, d, e UsdaNutrientIncomingName

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, usdaNutrientDBTypes, false, strmangle.SetComplement(usdaNutrientPrimaryKeyColumns, usdaNutrientColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*UsdaNutrientIncomingName{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, usdaNutrientIncomingNameDBTypes, false, strmangle.SetComplement(usdaNutrientIncomingNamePrimaryKeyColumns, usdaNutrientIncomingNameColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddNutrientUsdaNutrientIncomingNames(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.NutrientUsdaNutrientIncomingNames().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveNutrientUsdaNutrientIncomingNames(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.NutrientUsdaNutrientIncomingNames().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if !queries.IsValuerNil(b.NutrientID) {
		t.Error("want b's foreign key value to be nil")
	}
	if !queries.IsValuerNil(c.NutrientID) {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.Nutrient != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.Nutrient != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.Nutrient != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.Nutrient != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.NutrientUsdaNutrientIncomingNames) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.NutrientUsdaNutrientIncomingNames[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.NutrientUsdaNutrientIncomingNames[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

